import React from 'react';

const Rank = ({box}) => {
	const no_of_people = box.length;
	return (
		<div>
			<div className='white f3'>
				{'There are ' + {no_of_people} + " peoples"}
			</div>
			// <div className='white f1'>
			// 	{'#5'}
			// </div>
		</div>
	)
}

export default Rank;
